contract SafeMath {
    function testUnderflow() public pure returns (uint256) {
        uint256 a = 0;
        a--;
        return a;
    }

    function testUncheckedUnderflow() public pure returns (uint256) {
        uint256 a = 0;
        unchecked {
            a--;
        }
        return a;
    }
}

